import './App.css';
import Navbar from './Komponensek/Navbar';
import {BrowserRouter as Router, Routes ,Route } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
     <Navbar/>
    <Routes>
      <Route path='/' element={<></>} exact/>
    </Routes>
     </Router>
     </>
  );
}

export default App;
